import ClassClick from './pages/ClassClick';
import EventBind from './pages/EventBind';
import ParentComponent from './pages/ParentComponent';
import UserGreeting from './pages/UserGreeting';
import NameList from './pages/NameList';
import Stylesheets from './pages/Stylesheets';
import InLine from './pages/InLine';
import Form from './pages/Form'
import SimpleForm from './pages/SimpleForm';
import CreateThread from './pages/CreateThread';
import ClickCounterTwo from './pages/ClickCounterTwo';
import HoverCounterTwo from './pages/HoverCounterTwo';
import User from './pages/User';

function App() {
    return (
        <>
            {/* <InLine /> */}
            {/* <Form /> */}
            {/* <SimpleForm /> */}
            {/* <CreateThread /> */}
            <ClickCounterTwo />
            <HoverCounterTwo />
            <User render = { (isLoggedIn) => isLoggedIn? 'Rex' : 'Guest'}/>
            {/* <Stylesheets primary={true} /> */}
            {/* <NameList /> */}
            {/* <UserGreeting /> */}
            {/* <ParentComponent /> */}
            {/* <EventBind /> */}
            {/* <FunctionClick />
            <ClassClick />
            <Counter />
            <Forum /> */}
        </>
    )
}

export default App;
